addToContainers_variable("Name", "Name of action to appear on HUD. Only applicable if a non BuildBuilding/Train/Upgrade action", "Classes/FContextButtonInfo/Variables/Name.html", [], "FContextButtonInfo");
addToContainers_variable("Image", "Image to appear in HUD. Only applicable if a non BuildBuilding/Train/Upgrade action", "Classes/FContextButtonInfo/Variables/Image.html", [], "FContextButtonInfo");
addToContainers_variable("HoveredImage", "The image for when the mouse is over a button for this ability. This will be ignored if you use a unified image for the HUD element this appears on.", "Classes/FContextButtonInfo/Variables/HoveredImage.html", ["hovered", "image"], "FContextButtonInfo");
addToContainers_variable("PressedImage", "The image for when the mouse is pressed on a button for this ability. This will be ignored if you use a unified image for the HUD element this appears on.", "Classes/FContextButtonInfo/Variables/PressedImage.html", ["pressed", "image"], "FContextButtonInfo");
addToContainers_variable("HighlightedImage", "", "Classes/FContextButtonInfo/Variables/HighlightedImage.html", ["highlighted", "image"], "FContextButtonInfo");
addToContainers_variable("HoveredSound", "The sound to play when the mouse is hovered over a button on a action bar for this ability. This will be ignored if you use a unified sound set in game instance BP", "Classes/FContextButtonInfo/Variables/HoveredSound.html", ["hovered", "sound"], "FContextButtonInfo");
addToContainers_variable("PressedByLMBSound", "The sound to play the moment the left mouse button is pressed on an action bar button for this ability. This will be ignored if you use a unified sound set in game instance BP", "Classes/FContextButtonInfo/Variables/PressedByLMBSound.html", ["pressed", "by", "l", "m", "b", "sound"], "FContextButtonInfo");
addToContainers_variable("PressedByRMBSound", "The sound to play at the moment the right mouse button is pressed on an action bar button for this ability. This will be ignored if you use a unified sound set in game instance BP", "Classes/FContextButtonInfo/Variables/PressedByRMBSound.html", ["pressed", "by", "r", "m", "b", "sound"], "FContextButtonInfo");
addToContainers_variable("Description", "A description of the ability. Will likely be ignored if this button is for BuildBuilding/Train/Upgrade", "Classes/FContextButtonInfo/Variables/Description.html", [], "FContextButtonInfo");
addToContainers_variable("ButtonType", "Type of button this is", "Classes/FContextButtonInfo/Variables/ButtonType.html", ["button", "type"], "FContextButtonInfo");
addToContainers_variable("bIsIssuedInstantly", "Does this action happen instantly or is another mouse click required? e.g. true = Zerg burrow command in Starcraft II false = High Templar Psionic Storm in SCII. This requires another click to select the location before the command is issued. False basically means the action requires targeting someone/somewhere", "Classes/FContextButtonInfo/Variables/bIsIssuedInstantly.html", ["is", "issued", "instantly"], "FContextButtonInfo");
addToContainers_variable("bIsIssuedToAllSelected", "If true this command will be issued to every unit selected (if they support the action). If false then only a single unit will be issued with the command and it will be the unit whose context menu is showing. e.g. True = Zerg burrow - all selected units will do it False = High Templar Psionic Storms - no matter how many High Templar are selected only one will do it", "Classes/FContextButtonInfo/Variables/bIsIssuedToAllSelected.html", ["is", "issued", "to", "all", "selected"], "FContextButtonInfo");
addToContainers_variable("bIsRangeRequirementStrict", "If true then a command for this ability can only be issued if the unit is in range of the target selectable/location. If false then the unit can always be issued the command and if they are not in range at the time of receiving the command then they will move in range and then use it. Strict is a bad name. Something better might be bMustUnitBeInRangeAtTimeOfIssue", "Classes/FContextButtonInfo/Variables/bIsRangeRequirementStrict.html", ["is", "range", "requirement", "strict"], "FContextButtonInfo");
addToContainers_variable("bCommandStopsMovement", "If this is true then a unit receiving this command will stop movement when they receive the command and after it has executed they will go idle where they are. If false unit will not stop moving while they execute the command (if bUseAnimation is true then they will play anim as they keep moving) and will continue carrying out previous command. If you want your unit to use this ability while they move then set this to false. Not 100% this has been implemented fully. For now it is not possible to have this as false and use an animation", "Classes/FContextButtonInfo/Variables/bCommandStopsMovement.html", ["command", "stops", "movement"], "FContextButtonInfo");
addToContainers_variable("bUseAnimation", "Whether to use an animation for this ability. If false then no animation will be played and ability will take effect instantly. Currently if true then bCommandStopsMovement will be automatically flagged as true", "Classes/FContextButtonInfo/Variables/bUseAnimation.html", ["use", "animation"], "FContextButtonInfo");
addToContainers_variable("bUsePreparationAnimation", "Whether to use a preparation animation. Currently this is only used by buildings. Make sure to adjust the variable PreparationAnimPlayPoint to suit when this anim should play", "Classes/FContextButtonInfo/Variables/bUsePreparationAnimation.html", ["use", "preparation", "animation"], "FContextButtonInfo");
addToContainers_variable("AnimationType", "The animation type to use for this ability. You should not use animation types that are common such as attack or move animations since these will have anim notifies that will cause crashes if used here. It is best to stick to animation types you have defined yourself or the ContextAction_1/2/3 types", "Classes/FContextButtonInfo/Variables/AnimationType.html", ["animation", "type"], "FContextButtonInfo");
addToContainers_variable("PreparationAnimationType_Building", "This animation plays at a certain point in the ability cooling down. e.g. in C&C generals: at approx 10 secs before your nuke becomes ready an animation plays that opens the silo and points the nuke upwards.", "Classes/FContextButtonInfo/Variables/PreparationAnimationType_Building.html", ["preparation", "animation", "type_", "building"], "FContextButtonInfo");
addToContainers_variable("AnimationType_Building", "Animation to use if a building is using the ability", "Classes/FContextButtonInfo/Variables/AnimationType_Building.html", ["animation", "type_", "building"], "FContextButtonInfo");
addToContainers_variable("bAnimationBlocksCommands", "If true then once the animation for this ability starts you will not be able to stop the animation with new commands until anim notify OnContextAnimationFinished is executed.", "Classes/FContextButtonInfo/Variables/bAnimationBlocksCommands.html", ["animation", "blocks", "commands"], "FContextButtonInfo");
addToContainers_variable("MouseAppearance", "Whether to use a custom mouse cursor or a decal when choosing where to use ability. If using CustomMouseCursor it is assumed at least DefaultMouseCursor has a valid path to a cursor. If using HideAndShowDecal it is assumed Decal is set", "Classes/FContextButtonInfo/Variables/MouseAppearance.html", ["mouse", "appearance"], "FContextButtonInfo");
addToContainers_variable("bRequiresSelectableTarget", "True = ability requires another selectable as a target False = any location in the world is good enough. E.g. True = Starcraft II Ghosts snipe ability False = Starcraft II Ghosts EMP ability", "Classes/FContextButtonInfo/Variables/bRequiresSelectableTarget.html", ["requires", "selectable", "target"], "FContextButtonInfo");
addToContainers_variable("bCanTargetInsideFog", "This is only relevant if the ability does not require a selectable as a target but requires a location in the world as a target. Whether we are allowed to use this ability on locations that are inside fog of war", "Classes/FContextButtonInfo/Variables/bCanTargetInsideFog.html", ["can", "target", "inside", "fog"], "FContextButtonInfo");
addToContainers_variable("bCanTargetEnemies", "Whether ability can use an enemy as a target", "Classes/FContextButtonInfo/Variables/bCanTargetEnemies.html", ["can", "target", "enemies"], "FContextButtonInfo");
addToContainers_variable("bCanTargetFriendlies", "Whether ability can use a selectable on your team as a target. Note if this and bCanTargetEnemies is false then your ability will not be able to target anything", "Classes/FContextButtonInfo/Variables/bCanTargetFriendlies.html", ["can", "target", "friendlies"], "FContextButtonInfo");
addToContainers_variable("bCanTargetSelf", "Whether can target self. bCanTargetFriendlies must be true for this to be relevant. If your ability wants to only target self then you can set bIsIssuedInstantly to false", "Classes/FContextButtonInfo/Variables/bCanTargetSelf.html", ["can", "target", "self"], "FContextButtonInfo");
addToContainers_variable("bCheckRangeAtAnimNotify", "Whether to check if in range at time anim notify to use ability happens. Only relevant for abilities that target another selectable. True = right before ability is done a range check happens False = once anim starts ability will be considered always in range no matter how far away the target moves", "Classes/FContextButtonInfo/Variables/bCheckRangeAtAnimNotify.html", ["check", "range", "at", "anim", "notify"], "FContextButtonInfo");
addToContainers_variable("AcceptableTargets", "The types of selectables this ability can target. E.g. a High Templars feedback can only target energy users. This is only for targeting purposes. Once the ability has been used it is possible its effect causes an AoE effect which hits types that are not this type. That is all up to how the ability has been implemented. You must add at least one type for your ability to be usable", "Classes/FContextButtonInfo/Variables/AcceptableTargets.html", ["acceptable", "targets"], "FContextButtonInfo");
addToContainers_variable("AcceptableTargetFNames", "AcceptableTargets as FNames", "Classes/FContextButtonInfo/Variables/AcceptableTargetFNames.html", ["acceptable", "target", "f", "names"], "FContextButtonInfo");
addToContainers_variable("DefaultMouseCursor", "Default mouse cursor for ability to show when not hovering over a selectable", "Classes/FContextButtonInfo/Variables/DefaultMouseCursor.html", ["default", "mouse", "cursor"], "FContextButtonInfo");
addToContainers_variable("AcceptableTargetMouseCursor", "Mouse cursor to appear when hovering over a selectable that is an acceptable target for this ability", "Classes/FContextButtonInfo/Variables/AcceptableTargetMouseCursor.html", ["acceptable", "target", "mouse", "cursor"], "FContextButtonInfo");
addToContainers_variable("UnacceptableTargetMouseCursor", "Mouse cursor to appear when hovering over a selectable that is not an acceptable target for this ability", "Classes/FContextButtonInfo/Variables/UnacceptableTargetMouseCursor.html", ["unacceptable", "target", "mouse", "cursor"], "FContextButtonInfo");
addToContainers_variable("DefaultMouseCursor_Info", "", "Classes/FContextButtonInfo/Variables/DefaultMouseCursor_Info.html", ["default", "mouse", "cursor_", "info"], "FContextButtonInfo");
addToContainers_variable("AcceptableTargetMouseCursor_Info", "", "Classes/FContextButtonInfo/Variables/AcceptableTargetMouseCursor_Info.html", ["acceptable", "target", "mouse", "cursor_", "info"], "FContextButtonInfo");
addToContainers_variable("UnacceptableTargetMouseCursor_Info", "", "Classes/FContextButtonInfo/Variables/UnacceptableTargetMouseCursor-2-0.html", ["unacceptable", "target", "mouse", "cursor_", "info"], "FContextButtonInfo");
addToContainers_variable("AcceptableLocationDecalInfo", "If bIsIssuedInstantly is false, the decal to draw under the mouse for when the location under the mouse is at a location where a command can be issued. Note about Radius: this is for visuals only. To change the actual area of effect of a action would need to be done in each implementation of the action ability (can also be done on a per-unit basis although this is not exposed to editor).", "Classes/FContextButtonInfo/Variables/AcceptableLocationDecalInfo.html", ["acceptable", "location", "decal", "info"], "FContextButtonInfo");
addToContainers_variable("UnusableLocationDecalInfo", "If bIsIssuedInstantly is false, the decal to draw under the mouse when it is at a position where a command cannot be issued because perhaps it is inside fog, out of range etc. This decal is optional. If not set then the AcceptableLocationDecal will always be shown. UE4 tip: If all you want to do is change the color of this material then it is a good idea to add a parameter to your AcceptableLocationDecal asset, make a material instance from it in editor and adjust that param value.", "Classes/FContextButtonInfo/Variables/UnusableLocationDecalInfo.html", ["unusable", "location", "decal", "info"], "FContextButtonInfo");
addToContainers_variable("Cooldown", "Cooldown 0 = no cooldown. Could remove this and have each unit set its own cooldown", "Classes/FContextButtonInfo/Variables/Cooldown.html", [], "FContextButtonInfo");
addToContainers_variable("InitialCooldown", "The cooldown this ability starts with. e.g. in C&C generals when you build a nuke silo you have to wait 6 minutes before you can use it. 0 = starts off cooldown", "Classes/FContextButtonInfo/Variables/InitialCooldown.html", ["initial", "cooldown"], "FContextButtonInfo");
addToContainers_variable("PreparationAnimPlayPoint", "How much time remaining for ability coming off cooldown when we should play the preparation animation. Makes sense for this to be no larger than Cooldown. e.g. if this is 10 then when the ability has 10 secs left before coming off cooldown then the preparation anim will play.", "Classes/FContextButtonInfo/Variables/PreparationAnimPlayPoint.html", ["preparation", "anim", "play", "point"], "FContextButtonInfo");
addToContainers_variable("SelectableResourceCost_1", "The selectable resource cost of this ability. Selectable resources are things like mana or energy. Currently each selectable is only allowed a maximum of 1 selectable resource so you cannot have costs like \"50 mana and 25 energy\".", "Classes/FContextButtonInfo/Variables/SelectableResourceCost_1.html", ["selectable", "resource", "cost_1"], "FContextButtonInfo");
addToContainers_variable("MaxRange", "Max range of action. 0 = unlimited range", "Classes/FContextButtonInfo/Variables/MaxRange.html", ["max", "range"], "FContextButtonInfo");
