addToContainers_struct("FProductionQueue", "A queue that produces buildings/units/upgrades. Found on buildings mostly but there is also one the player state. A single queue cannot produce in parallel. My implementation of queues: Production orders come in 3 types: build building, train unit and research upgrade. Queues come in 2 types: - A \"persistent\" queue which is used only for building buildings when clicking on a button in the HUD persistent panel (like in C&C). However if clicking a unit/upgrade in the HUD persistent panel then the production will be put into a \"context\" queue (described below). - A \"context\" queue which handles every other case. This includes producing units/upgrades from the HUD persistent panel, or producing anything by clicking on the building and pressing a button on its context menu. Buildings have one of each queue type. This means you can have a construction yard type building that will construct buildings in its \"persistent\" queue while at the same time it is possible to click on that construction yard building and build units/upgrades/buildings (buildings is kind of unexpected behavior here but can be done) in its \"context\" queue. Or you can produce units/upgrades from it by clicking a unit/upgrade button in the HUD persistent panel. So you can have a construction yard that constructs a building while at the same time trains a unit or researches an upgrade.", "Classes/FProductionQueue/FProductionQueue.html", ["production", "queue"], "");
