addToContainers_variable("OnDroppedAnim", "Optional animation to play when the item is dropped. Montage should have a section at the end that loops idle, and blend in time should be set to 0. Quick note: the gun in the first person shooter example doesn\'t have any animations and it doesn\'t have a T-pose from the looks of it. Perhaps looping idle at the end isn\'t required. This is only relevant if MeshInfo\'s mesh is a skeletal mesh.", "Classes/FInventoryItemInfo/Variables/OnDroppedAnim.html", ["on", "dropped", "anim"], "FInventoryItemInfo");
addToContainers_variable("MeshInfo", "The mesh to use to display this item when it has a presence in the world. I *think* setting location to != ZeroVector will actually change the item actor\'s GetActorLocation(), which is not really what I want. Solution would be to use a shape comp as AInventoryItem\'s root comp just like I have done with infantry/buildings. This is all assuming though that moving the root component implies moving the actor. If there\'s a way to not do that then I do not need the shape comp as root. But I do not think there is. So bottom line if users use an offset here then the actor location will not be on the ground. For small offsets this doesn\'t matter too much I guess, just IsInRangeOfItem calcs will be slightly off", "Classes/FInventoryItemInfo/Variables/MeshInfo.html", ["mesh", "info"], "FInventoryItemInfo");
