addToContainers_variable("MaxNumPerStack", "The maximum amount of this item there can be in a stack e.g. in dota clarity potions can stack like I don\'t know perhaps 99 times, but a claymore you can only have 1 of in a stack. So if you pickup another claymore it will be in its own inventory slot. 0 = unlimited.", "Classes/FInventoryItemInfo/Variables/MaxNumPerStack.html", ["max", "num", "per", "stack"], "FInventoryItemInfo");
