addToContainers_variable("ItemType", "The item type this info struct is for. For a long time I kept this off this struct, so there may be parts of code getting the type in a less efficient way than just querying this struct. Lots of functions have params that are both the item type + this struct so they can get rid of the item type param", "Classes/FInventoryItemInfo/Variables/ItemType.html", ["item", "type"], "FInventoryItemInfo");
