addToContainers_variable("bRestrictedToCertainTypes", "If true then only a certain list of unit types are allowed to: - pick up this item off the ground - purchase this item It may still be possible for the item to enter their inventory in other ways. Also this will not be checked when creating combination items.", "Classes/FInventoryItemInfo/Variables/bRestrictedToCertainTypes.html", ["restricted", "to", "certain", "types"], "FInventoryItemInfo");
