addToContainers_struct("FInventory", "Holds information about a selectable\'s inventory. ServerIndex == SlotsArrayIndex LocalIndex == DisplayIndex ------------------------------------------------------------------------------------------------ Some info about how inventories behave: Short explanation: Very similar to dota I think Longer explanation: - when a stackable item is added to inventory it will try and be placed on an already existing stack of the same type if one exists. Otherwise it will go into an empty slot. - in regards to items combining to create other items: The initial item must be added to a slot first before combination item creation can happen. So if your inventory is full and you know that aquiring an item will cause items to combine and your inventory to stay at/below capacity then you cannot aqurie that item, unless it can go in an empty slot or on top of another. - Usable items with more than 1 charge are not allowed to stack. e.g. you could not let diffusal blades stack. If you want to do similar behavour to tengu\'s you could just allow the shop that sells them to sell them in lots of 3. ------------------------------------------------------------------------------------------------", "Classes/FInventory/FInventory.html", [], "");
