addToContainers_function("AtTotalNumLimit", "For a item type check whether we cannot put anymore of it into inventory. Works for both stackable and non-stackable item types, although it is more efficient to call AtNumStacksLimit if we know the item is not stackable. ", "Classes/FInventory/Functions/AtTotalNumLimit.html", ["at", "total", "num", "limit"], "FInventory");
