addToContainers_variable("SlotsArray", "Array of all the items in the inventory. The server keeps a copy of this and so do clients. The server and client versions are always exactly the same (after RPCs arrive of course). Reordering your inventory is achieved using the two arrays ServerIndexToLocalIndex and LocalIndexToServerIndex. My notes: It may be possible to expose this to editor to allow users to have units start with items. We would need to make sure that the bonuses are applied on spawn but there\'s lots of other stuff that needs checking: - checking that we didn\'t already start with a recipe item e.g. if the user puts a claymore, demon edge and scared relic in our inventory then we\'ve basically started with a divine rapier and we would need to make sure the 3 items are turned into it. - checking uniquess is obeyed - checking stack size limit is obeyed", "Classes/FInventory/Variables/SlotsArray.html", ["slots", "array"], "FInventory");
