addToContainers_struct("FSelectableResourceInfo", "A struct that holds information about a selectable resource. A selectable resource is something like mana or energy. My notes: we could ditch using NumTicksAhead and instead just use CurrentNumTicks which would be the game tick that it is up to date with currently. Using NumTicksAhead is actually more cumbersome. But the only reason I use it is because I want to avoid a mass branch prediction miss in a single frame when the game tick count is incremented to 255 which then means it has to be changed to 0.", "Classes/FSelectableResourceInfo/FSelectableResourceInfo.html", ["selectable", "resource", "info"], "");
