addToContainers_variable("MaxAmount", "The maximum amount of this resource we are allowed e.g. for high templars it is 200. The max value of this is dependent on FSelectableResourceInfo::NUM_DECIMAL_PLACES. By default this is 4. INT32_MAX / 10^4 = INT32_MAX / 10000 = ~214 000. By default this number should stay below 214 000. If you decide to use 5 decimal places then you will need to then stay below 21 400, and so on. It\'s probably good to stay a little more below that even. Good way to remove this restriction: just make AmountUndivided an int64", "Classes/FSelectableResourceInfo/Variables/MaxAmount.html", ["max", "amount"], "FSelectableResourceInfo");
