addToContainers_variable("bCanEverEnterStealth", "This is a contract variable. Setting this to true means it is possible for this unit to enter stealth at some point. Setting this to false can be an optimization", "Classes/FInfantryAttributes/Variables/bCanEverEnterStealth.html", ["can", "ever", "enter", "stealth"], "FInfantryAttributes");
addToContainers_variable("bSpawnStealthed", "If true unit will spawn stealthed. Optionally you can have this unit reveal itself when it does something by adding the anim notify \'OnExitStealthMode\' to the Attack/GatherResources/whatever animations. My notes: I think this variable basically means the unit is a stealth unit e.g. jarmen kell, dark templars. If an upgrade now wants to make a unit stealth then this is the variable to set.", "Classes/FInfantryAttributes/Variables/bSpawnStealthed.html", ["spawn", "stealthed"], "FInfantryAttributes");
addToContainers_variable("bInToggleStealthMode", "If true then the unit is in a state where if it decides to break its stealth then it will re-enter it after a StealthRevealTime delay. False basically means we won\'t try re-enter stealth This will rarely change during gameplay. I don\'t even know but this variable might be redundant. Anytime this is used bSpawnStealthed could possibly replace it", "Classes/FInfantryAttributes/Variables/bInToggleStealthMode.html", ["in", "toggle", "stealth", "mode"], "FInfantryAttributes");
addToContainers_variable("StealthRevealTime", "Time from when the unit breaks stealth to when it should re-enter stealth. \"Breaks stealth\" means you executed an action that should remove your stealth, and has nothing to do with being detected by an enemy. Some special values for this: - Setting this to 0 and/or not setting the \'OnExitStealthMode\' anim notifies means unit will not reveal self ever (similar to ghosts or dark templars in SCII) unless given an explicit command to do so (e.g. using unclock for ghosts). - Setting this to less than 0 means unit will never re-enter stealth after notify and will require an explicit command to re-enter stealth", "Classes/FInfantryAttributes/Variables/StealthRevealTime.html", ["stealth", "reveal", "time"], "FInfantryAttributes");
addToContainers_variable("StealthMaterialParamName", "Name of param in dynamic material instance that controls the stealth effect", "Classes/FInfantryAttributes/Variables/StealthMaterialParamName.html", ["stealth", "material", "param", "name"], "FInfantryAttributes");
addToContainers_variable("InStealthParamValue", "Value to set on stealth material instance when in stealth mode. If the param is controlling alpha then this will likely want to be something less than 1", "Classes/FInfantryAttributes/Variables/InStealthParamValue.html", ["in", "stealth", "param", "value"], "FInfantryAttributes");
addToContainers_variable("bCanGainExperience", "Whether the unit can ever gain experience", "Classes/FInfantryAttributes/Variables/bCanGainExperience.html", ["can", "gain", "experience"], "FInfantryAttributes");
addToContainers_variable("ExperienceRequirementsTMap", "How much experience is required to reach the level. Non-cumulative so these values are how much to go from the current level to the next. If this is greyed out check LevelingUpOptions::EXPERIENCE_ENABLED_GAME in ProjectSettings.h", "Classes/FInfantryAttributes/Variables/ExperienceRequirementsTMap.html", ["experience", "requirements", "t", "map"], "FInfantryAttributes");
addToContainers_variable("ExperienceRequirementsArray", "Values from TMap. Gets populated in post edit. Index 0 = first gainable level, index 1 = second gainable level, and so on e.g. If you start on level 1 and can level up to 3: index 0 = EXP requirement for level 2 index 1 = EXP requirement for level 3", "Classes/FInfantryAttributes/Variables/ExperienceRequirementsArray.html", ["experience", "requirements", "array"], "FInfantryAttributes");
