addToContainers_variable("bCanBuildBuildings", "Whether the unit can build buildings. This is set automatically during post edit, usually if the context menu has at least one button for building a building", "Classes/FInfantryAttributes/Variables/bCanBuildBuildings.html", ["can", "build", "buildings"], "FInfantryAttributes");
addToContainers_variable("bCanRepairBuildings", "Whether unit can repair buildings. Repairs only, not construction", "Classes/FInfantryAttributes/Variables/bCanRepairBuildings.html", ["can", "repair", "buildings"], "FInfantryAttributes");
addToContainers_variable("ResourceGatheringProperties", "Resource collection properties. The game wide rules for resource collection are as follows: ----- It\'s basically the same as SCII. To be more specific: ------ - Each resource spot (similar to a mineral patch in SCII) can provide only one type of resource. - Each resource drop point (similar to a nexus in SCII) is allowed to take in multiple resource types. - A collector (like probes in SCII) must stay its full duration at a resource spot uninterrupted for it to gain its capacity in resources. If interrupted it must restart the timer for gathering resource (same behavior as SCII I believe). - If a collector holding resources chooses to gather from another resource spot of a different resource type it will lose the resources it has already gathered upon successfully gathering the new resource type (same behavior as SCII I believe)", "Classes/FInfantryAttributes/Variables/ResourceGatheringProperties.html", ["resource", "gathering", "properties"], "FInfantryAttributes");
