addToContainers_variable("CameraMouseWheelZoomCurve", "SHOULD BE LINEAR, NOT CURVED. Actually zooming doesn\'t really work very well anyway so doesn\'t matter. Curve used for gradual zoom in/out when scrolling mouse wheel. Can be left null and zoom amount will be changed instantly. X axis = base time to reset camera. Will be multiplied by CameraZoomSpeed Y axis = Lerp amount, range should be from 0 to 1 At some point a pointer on the PC is set to this. But are there performance gains from having it as a EditDefaultsOnly variable on the PC to begin with? Unless there is some serious black magic with UE4 then I would think not. If there is though could just remove that variable on PC and go GI->GetCameraMouseWheelZoomCurve() whenever we need it.", "Classes/URTSGameInstance/Variables/CameraMouseWheelZoomCurve.html", ["camera", "mouse", "wheel", "zoom", "curve"], "URTSGameInstance");
