addToContainers_struct("ABuffAndDebuffManager", "Buff and debuff manager is where to define the behavior of buffs and debuffs. This file has nothing to do with abilities. All it has is the behavior for each buff/debuff. Assign function pointers in URTSGameInstance::SetupBuffsAndDebuffInfos() Buffs/debuffs also really have nothing to do with upgrades. Buffs and debuffs come in two types: static and tickable. Most of your buffs/debuffs will likely be tickable. Static buffs/debuffs do not have any tick logic and never expire on their own. They require some event to remove them. They give a slight performance increase over tickable buffs/debuffs so you should use them when you can. @See EStaticBuffAndDebuffType and ETickableBuffAndDebuffType About ticking: if a buff ticks 3 times with a 2sec tick interval it will last 6 seconds, and does not tick when first applied but rather 2 secs after. This behavior can easily be changed though in the buffs TryApplyTo function. If you want it to tick straight away then just add its logic in there Stackable buffs/debuffs not implemented Trying this with function pointers instead of virtuals but may switch to virtuals. =========================================================================================== How to create new buffs/debuffs: 1. Close editor if it is open 2. In CommonEnums.h add an entry to either EStaticBuffAndDebuffType or ETickableBuffAndDebuffType. 3. Copy and paste a group of 3 function signatures below. Do not need the DoTick one if you chose to add a static buff/debuff in step 2. 4. Implement the 3 or 2 functions. 5. In URTSGameInstance::SetupBuffsAndDebuffInfos add entry for the newly defined buff/debuff. 6. Compile C++ code. 7. Inside your game instance blueprint there should be an entry for the buff/debuff you just defined. Change the values to suit the behavior of your buff/debuff", "Classes/ABuffAndDebuffManager/ABuffAndDebuffManager.html", ["buff", "and", "debuff", "manager"], "");
