addToContainers_struct("ACPUControllerTickManager", "Tick manager responsible for ticking the CPU player AI controllers. The tick manager is here so at most one CPU player ticks each tick. CPU player tick behavior can range from doing next to nothing to doing many sweeps and large amounts of iteration. By using the tick manager this guarantees at most one AI controller ticks each engine tick. CPU player tick rate is dependent on engine tick rate i.e. at 120fps twice as many AI controller ticks will happen than if at 60fps. This can be easily changed but isn\'t that big of a deal. A good thing to note though is that the number of CPU players in the match does not affect how often they will tick i.e. in a 1 CPU player match, that CPU player ticks just as often as if they were in a 7 CPU player match.", "Classes/ACPUControllerTickManager/ACPUControllerTickManager.html", ["c", "p", "u", "controller", "tick", "manager"], "");
