addToContainers_struct("FTemporaryFogRevealEffectInfo", "A temporary fog reveal effect reveals the fog of war around a location for a certain amount of time. They can optionally reveal stealthed selectables too. Examples of these effects: - in C&C Generals: USA command center scan - in SCII: Terran\'s command center scan They may not happen instantly but after a small delay. The reason for this is that suddenly revealing a location might look bad because replication would usually be turned off for actors in fog. Instead we \'prepare\' the area we\'re about to reveal by turning on replication for the actors in the area first and then revealing the location. Note: I have not actually implemented any of this logic yet. It will probably come later when I choose to implement it for units/buildings etc. FIXME: implement this \'pre revealing\' effect on this effect if I end up implementing it for units/buildings etc", "Classes/FTemporaryFogRevealEffectInfo/FTemporaryFogRevealEffectInfo.html", ["temporary", "fog", "reveal", "effect", "info"], "");
