addToContainers_struct("AFogOfWarManager", "------------------------------------------------------------------------------------------ This class if for single threaded fog of war that runs on the game thread only. Look at MultithreadedFogOfWar.h for an implementation that runs on its own thread. ------------------------------------------------------------------------------------------ On clients: Responsible for deciding what tiles your team can see, hiding/revealing things on those tiles and rendering the fog of war. On server: Responsible for deciding which tiles every team can see and storing this information for 2 reasons: - Knowing what can see what for AI behavior purposes - Stopping replication updates on a per connection basis for some things inside fog Server also hides/reveals the things the local player can/can\'t see and renders its own fog Currently relies on fog of war volume having equal width and length", "Classes/AFogOfWarManager/AFogOfWarManager.html", ["fog", "of", "war", "manager"], "");
