addToContainers_struct("AInventoryItem", "Inventory items are items that can go in the inventory of a selectable. This class is an inventory item that has been placed/dropped/whatever into the world. You can place these into maps to have them start there when the match begins, but they only show as a sprite while during design time. Make sure to set their type in their blueprint. There\'s no shape component used for selection - it\'s up to the mesh. Can\'t you make a custom physics asset that can be like a cube and use that for the mesh\'s collision? There is an expectation that this actor is visible so if you make blueprints of this class do not adjust their visibilities. ----------------------------------------------------------------------------------------------- My notes: can\'t quite get the functionality that I want in regards to meshes. What I want is: - you define the mesh you want to use for an item type in GI blueprint - you can place these actors into the world. They will have that mesh that was set in GI BP. In post edit world and GI are null. Would be able to accomplish this by: - learning how to modify another BP in post edit e.g. we edit this but also modify GI BP - writing the mesh reference to disk meaning in post edit we can access it. Maybe a data table could accomplish this I don\'t know though, I know nothing about data tables. So in the mean time its always the default cube in editor map during design time. -----------------------------------------------------------------------------------------------", "Classes/AInventoryItem/AInventoryItem.html", ["inventory", "item"], "");
