addToContainers_struct("AAbilityBase", "This class should be overridden. It is used to create effects of when context buttons are clicked, such as calling down an artillery strike or healing an ally. It is very basic. All functionaility is left to the user to implement. Some notes though: This is a manager/info type class - only one effect actor is spawned for every type of effect. This means using things like GetActorLocation() within a class deriving from this is not useful. Instead a struct for each active effect is used. This stores state for each instance of the effect active. If you need more state info then create a custom struct for your custom effect. See ArtilleryStrike.h for an example. Because of this, no actors are spawned during gameplay. \"Spawn\" behavior should be implemented inside Server_Start/Client_Start. Effects do not replicate. If the effect has random behavior then a random number seed can be passed to clients by saving the return value of Sever_Start. Otherwise you can ignore it =============================================================================================== ----------------------------------------------------------------------------------------------- A non-comprehensive list of things you cannot do with abilities: - put another ability on cooldown (similar to counterspell in WoW) - teleportation effects ----------------------------------------------------------------------------------------------- =============================================================================================== List of things already checked by PC and do not need to be in the IsUsable_ functions: - whether ability is on cooldown - whether target is not null, valid, the right affiliation and whether they are ourself - whether target is the right targeting type - maybe some other stuff TODO inherit from UObject instead of AInfo since not replicated?", "Classes/AAbilityBase/AAbilityBase.html", ["ability", "base"], "");
