addToContainers_function("IsUsable_SelfChecks", "This is called for both 1 and 2 click abilities. For 2 click abilities it is called both when the first click is done and when the 2nd is done also (could change this though but I don\'t forsee any abilities that wouldn\'t want this called automatically on the 2nd click aswell - it doesn\'t really make sense for an ability to allow the user to find a target/location for it but then not do those same checks when it comes time to actually activate the ability). Can probably assume instigator is valid. SelfChecks isn\'t a 100% true name. Can check anything like the elapsed time in the match, more accurate is IsUsable_OnButtonClickOrMouseClick This function returns whether the selectable instigating the ability is in a state that allows it to do so. Some things like cooldown are automatically checked and do not need to be included in this check. If your ability has some custom logic like \"only usable when below 40% health\" or \"only usable if the buff \"Haste\" is present then this is where to check that stuff now ", "Classes/AAbilityBase/Functions/IsUsable_SelfChecks.html", ["is", "usable_", "self", "checks"], "AAbilityBase");
addToContainers_function("IsUsable_SelfChecks", "Overloaded version for the times we don\'t care about the reason", "Classes/AAbilityBase/Functions/IsUsable_SelfChecks-2-0.html", ["is", "usable_", "self", "checks"], "AAbilityBase");
addToContainers_function("IsUsable_TargetChecks", "This is only for abilities that require 2 mouse clicks. Given a instigator and a target return whether the target is a useable target. Possibly can assume both are valid. Currently some stuff is already done by the player controller such as: - targeting type check - whether target is friendly/hostile - whether we can target self - more stuff See FContextButtonInfo so these things do not need to appear in this function. TargetChecks isn\'t 100% accurate. Can check other things too. More accurate would be IsUsable_OnTargetAquiredChecks Main purpose of this function is to check things on the target, not yourself ", "Classes/AAbilityBase/Functions/IsUsable_TargetChecks.html", ["is", "usable_", "target", "checks"], "AAbilityBase");
addToContainers_function("IsUsable_TargetChecks", "Overloaded version for the times when we don\'t care about the reason", "Classes/AAbilityBase/Functions/IsUsable_TargetChecks-2-1.html", ["is", "usable_", "target", "checks"], "AAbilityBase");
