addToContainers_variable("MinInterval", "Minimum amount of time between projectile spawn. To eliminate randomness set this equal to MaxInterval. If both are equal then all projectiles spawn at the same time", "Classes/AAbility_ArtilleryStrike/Variables/MinInterval.html", ["min", "interval"], "AAbility_ArtilleryStrike");
