addToContainers_variable("YawRotationCurve", "Optional. A curve to define how yaw rotation is applied to the spawn location of each projectile relative to the last projectile spawned. Without a curve the rotation will be a random float in the range 0 to 360. This means there is a chance projectiles can spawn close to each other which may not be desired behaviour. With a curve you can define the chances of this happening. X axis = arbitrary. A random point will be picked along the X axis and its Y value (normalized to the range 0...180, and given random sign) will be the rotation to apply to the next projectile Y axis = rotation to apply to next projectile. For clarity you may want to set the range for the Y axis to be from 0 to 180", "Classes/AAbility_ArtilleryStrike/Variables/YawRotationCurve.html", ["yaw", "rotation", "curve"], "AAbility_ArtilleryStrike");
addToContainers_variable("DistanceFromCenterCurve", "Just like the rotation curve but for the distance to spawn the projectile from the center. This one is not relative to the last projectile spawned though. Automatically normalized at runtime. If no curve is specified a linear curve will be used (random value from 0 to Radius, with each value equal probability). X axis = arbitrary. A random point will be picked along the X axis and its Y value (normalized to the range 0...Radius) will be the distance from center next projectile will spawn at Y axis = distance from center (mapped from [YAxisMin, YAxisMax] to [0, Radius])", "Classes/AAbility_ArtilleryStrike/Variables/DistanceFromCenterCurve.html", ["distance", "from", "center", "curve"], "AAbility_ArtilleryStrike");
