addToContainers_struct("FFloatAttributeBase", "============================================================================================== A single floating point attribute. Can be modified and will always return to its exact float value eventually i.e. it is not suspectable to floating point errors in the long run. Can be modified by either adding a flat value e.g. add 20 to attack range, or using a multiplier e.g. increase attack range by 10%. Multipliers can be applied in either additive or multiplicative ways e.g. attack range is 500 We get a buff that increases it by 10%. We now have 550 attack range We get another buff that increases attack range by 50%. We can choose to either apply it additively so we now have a 60% boost and have 800 attack range or it can be done multiplicatively and the boost is now 66% and attack range is 830. Addition bonuses are always applied first then the multiplier is applied. Allowing it the other way around I think will require adding more variables. ==============================================================================================", "Classes/FFloatAttributeBase/FFloatAttributeBase.html", ["float", "attribute", "base"], "");
