addToContainers_struct("UPopupWidget", "Popup widgets are widgets that get shown briefly on screen to convey a message. e.g. \"Not enough players in lobby\". They are not menus and have no interactibility. They will become hidden anytime the menu widget is changed. Widget anim breakdown: All widget anims are optional. - If no anims are set then widget will be shown/hidden instantly. It will be shown for the duration param of func Show(). - If ShowAnim and/or HideAnim are set then they will play when the widget is requested to be shown/hidden. Duration param in func Show() times from the point where ShowAnim finishes. - If SingleAnim is set then ShowAnim and HideAnim are both ignored. Duration param in func Show() is also ignored. This SingleAnim will play when the widget is requested to be shown and is repsonsible for making the widget go away eventaully", "Classes/UPopupWidget/UPopupWidget.html", ["popup", "widget"], "");
