addToContainers_enum("ESoundFogRules", "Rules a sound obeys in relation to fog of war. Maybe think ofa slightly better name like ESoundHearingRules. Because some of the options aren\'t related to fog of war at all", "Enums/ESoundFogRules/ESoundFogRules.html", ["sound", "fog", "rules"], "");
addToContainers_enumValue("Ignore", "Ignore fog of war completely. If player positions camera over sounds location then they will be able to hear it, whether the location is revealed or not. Exactly the same as if you were to take a UAudioComponent and play the sound on that. My note: this doesn\'t fully work. If an actor has not replicated yet then the sound is never known which is not the correct behavior. Don\'t think many people will use this though.", "Enums/ESoundFogRules/Values/Ignore.html", [], "ESoundFogRules");
