addToContainers_enumValue("InstigatingTeamOnly", "Only the team making the sound can hear it", "Enums/ESoundFogRules/Values/InstigatingTeamOnly.html", ["instigating", "team", "only"], "ESoundFogRules");
addToContainers_enumValue("AlwaysKnownOnceHeard", "Once the sound is heard once it can be heard forever. Worse performance than DecideOnSpawn", "Enums/ESoundFogRules/Values/AlwaysKnownOnceHeard.html", ["always", "known", "once", "heard"], "ESoundFogRules");
addToContainers_enumValue("DynamicExceptForInstigatorsTeam", "Sound will become unheard if it is inside fog of war, except for the team that instigated the sound. For them it will always be heard even if the sound\'s location becomes inside fog of war. Worse performance than DecideOnSpawn.", "Enums/ESoundFogRules/Values/DynamicExceptForInstigatorsTeam.html", ["dynamic", "except", "for", "instigators", "team"], "ESoundFogRules");
addToContainers_enumValue("Dynamic", "Sound will change from being heard/unheard based on its current locations fog status. This has worse performance than all above but it\'s really no biggie.", "Enums/ESoundFogRules/Values/Dynamic.html", [], "ESoundFogRules");
