addToContainers_enum("EHUDPersistentTabButtonDisplayRule", "Rule for the ordering of buttons on the HUD persistent panel\'s tabs", "Enums/EHUDPersistentTabButtonDispla-2-2/EHUDPersistentTabButtonDispla-2-2.html", ["h", "u", "d", "persistent", "tab", "button", "display", "rule"], "");
addToContainers_enumValue("NoShuffling_HideUnavailables", "All buttons are added on setup. Buttons that that should not be clickable are made hidden", "Enums/EHUDPersistentTabButtonDispla-2-2/Values/NoShuffling_HideUnavailables.html", ["no", "shuffling_", "hide", "unavailables"], "EHUDPersistentTabButtonDisplayRule");
addToContainers_enumValue("NoShuffling_FadeUnavailables", "Basically the same as NoShuffling_HideUnavailables but the opacity of the button can be set instead of making it fully hidden. Using opacity as 0 basically makes it the same as NoShuffling_HideUnavailables but I don\'t know whether there is a performance penalty for choosing to use 0 opacity instead of just making it hidden so that is why this value exists", "Enums/EHUDPersistentTabButtonDispla-2-2/Values/NoShuffling_FadeUnavailables.html", ["no", "shuffling_", "fade", "unavailables"], "EHUDPersistentTabButtonDisplayRule");
addToContainers_enumValue("SameEveryTime", "The order of the buttons will be the same every time. E.g. if you have 10 items that appear in the tab and you give them priorties 1 through to 10. Then item 10 always comes after item 9, 9 after 8 etc. An example: You produce a building that lets you train items 1, 4, 6, and 10. Then the tab will show 1, 4, 6, 10 in that order. You then produce a building that can train 2 and 8. Now the tab will show 1, 2, 4, 6, 8, 10 in that order.", "Enums/EHUDPersistentTabButtonDispla-2-2/Values/SameEveryTime.html", ["same", "every", "time"], "EHUDPersistentTabButtonDisplayRule");
addToContainers_enumValue("OrderTheyBecomeAvailable", "I honestly can\'t remember but I think RA2 does it this way (and maybe every other C&C) Quick explanation: the order buildings are built affects the ordering of the buttons. E.g. if you build a war factory you can build rhinos, terror drones, flak tracks and war miners. Then if you build a barracks you can build constripts and attack dogs. On the units tab it will show in this order: war miner, rhino, flak track, terror drone, constript and finally attack dog. But if you were to build the barracks first then build the war factory then it will show conscript, attack dog, war miner, rhino, flak track and finally terror drone. So that\'s what this option is. I think units and vehicles tab is actually seperate in RA2 so pretend I said war factory and shipyard instead of war factory and barracks.", "Enums/EHUDPersistentTabButtonDispla-2-2/Values/OrderTheyBecomeAvailable.html", ["order", "they", "become", "available"], "EHUDPersistentTabButtonDisplayRule");
