addToContainers_enum("EMappingTarget", "------------------------------------------------------------------------------------------------ FIXME Issues in this file: I ran into a crazy bug. The jist of it was that I could not declare function pointer variables in my class otherwise the arrays would not work. That\'s right. Simply declaring the function pointer variable and doing absolutally nothing with it will cause the array to have .Num() of zero or if using regular C arrays the values will be different every time and never the correct ones. But if I simply removed the function pointer variables from the class then it would work. The implications of this bug is that I have to use FName to define the function to call, and every input function in PC must be a UFUNCTION. In PC::SetupInputComponent the functions are bound by name or function pointer. I hope binding input to a UInputComponent with FNames instead of raw function pointers doesn\'t have any effect on performance. But it binds it as a dynamic delegate so I\'m pretty sure it does. ------------------------------------------------------------------------------------------------", "Enums/EMappingTarget/EMappingTarget.html", ["mapping", "target"], "");
