addToContainers_typedef(")", "The function that is called when the buff/debuff is removed from the target (tickable buffs/debuffs only, use Static_FunctionPtr_OnRemoved for static buffs/debuffs) @param Target - the selectable this buff/debuff was applied to @param RemovalInstigator - the selectable that instigated removing the buff/debuff. When the buff/debuff is removed because its time has expired then this will just be null or point to the target or something - haven\'t decided yet. When the buff/debuff is removed because the target reaches zero health from another source then it will point to the instigator of the damage that caused the target to reach zero health. Finally when removed for some other reason (e.g. some \'cleanse\' type spell) then it will point to the selectable that instigated that spell. At least that\'s the plan @param StateInfo - info about the state of the buff/debuff @param RemovalReason - the reason the buff/debuff has been removed @param BuffOrDebuffInfo - info struct in case it is needed", "GlobalTypedefs/)-2-3.html", [], "");
